boolean.sol.content:
// SPDX-License-Identifier: GPL-3.0

pragma solidity >0.5.0 < 0.8.0;

contract bools
{
    bool public value=true;

   
    function check(uint x) public returns(bool)
{
    if (x<45)
    {
        value=true;
        return value;
    }
}
}

